import React, { Component } from 'react'
import PlayQue from "../components/Question/PlayQue"
import { Card, Menu, Breadcrumb, Button,Typography } from 'antd';

export class List extends Component {

    render() {
        const { Text } = Typography;
        return (
            <Card
            hoverable
            cover={<img alt="example" src={this.props.questionListDetail.image} />}
          >
<h4 style={{height:"120px"}}>{this.props.questionListDetail.name}</h4>
<p style={{height:'250px',overflowY:"scroll"}}>{this.props.questionListDetail.description}</p>
<hr></hr>
<Text code>{this.props.questionListDetail.price} Bath </Text>
<Button>Add to cart</Button>
          </Card>
        )
    }
}

export default List
